import React from 'react';
import { Navbar } from 'react-bootstrap';

import { Component } from 'react';

class NavCmp extends Component {
	render() {
		return (
      <Navbar bg="light">
        <Navbar.Brand>
            React-Bootstrap
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
      </Navbar>
    );
	}
}

export default NavCmp;
